import React from 'react';
import { Route } from 'react-router-dom';
import './App.css';
import Login from './components/Login';

import SignUp from './components/SignUp';

function App() {
  return (

    <div>
       <Route>
       <SignUp />
       </Route>

       <Route>

      <Login />
       </Route>

    </div>

  )
}

export default App;
